namespace dotless.Core.Test.Specs.Functions
{
    using Core.Exceptions;
    using NUnit.Framework;

    public class DataUriFixture : SpecFixtureBase
    {
        // Not done:
        // - Error message if files are greater than 32kb for IE8 compatibility mode and fallback to url (there is no IE8 compatibility mode in dotless)
        // - Ability to embed ascii files without base64 encoding them

        [Test]
        public void BinaryFileIsEmbeddedAsBase64()
        {
            AssertExpression("url(\"data:image/gif;base64,\")",
                "data-uri('./resource/data-uri/unicorn.gif')");
        }

        [Test]
        public void MimeTypeIsBasedOnFileExtensionIfNoMimeTypeIsSet()
        {
            AssertExpression("local('Lobster'), url(\"data:application/font-woff;base64,\") format('woff')",
                "local('Lobster'), data-uri('./resource/data-uri/lobster.woff') format('woff')");
        }

        [Test]
        public void MimeTypeCanBeOverridden()
        {
            AssertExpression("local('Lobster'), url(\"data:text/png;base64,\") format('woff')",
                "local('Lobster'), data-uri('text/png', './resource/data-uri/lobster.woff') format('woff')");
        }

        [Test]
        public void EncodingCanNotBeOverridden()
        {
            AssertExpression("local('Lobster'), url(\"data:text/png;base64,\") format('woff')",
                "local('Lobster'), data-uri('text/png;ascii', './resource/data-uri/lobster.woff') format('woff')");
        }

        [Test]
        public void ParsingExceptionIfNoFilename()
        {
            Assert.Throws<ParserException>(() => EvaluateExpression("data-uri()"));
        }

        [Test]
        public void ParsingExceptionIfCanNotReadEmbeddedFile()
        {
            string filename = "file-that-does-not-exist.png";

            var parsingException = Assert.Throws<ParserException>(() =>
                EvaluateExpression("data-uri('" + filename + "')")).InnerException as ParsingException;

            Assert.That(parsingException.Message, Does.Contain(filename));
        }

        [Test]
        public void ParsingExceptionIfEmbeddedFileIsNotALocalFile()
        {
            string url = "http://lesscss.org/public/img/logo.png";
            var parsingException = Assert.Throws<ParserException>(() =>
                EvaluateExpression("data-uri('" + url + "')")).InnerException as ParsingException;

            Assert.That(parsingException.Message, Does.Contain(url));
        }
    }

}
